import '../index.css';
import Home from './home';
import ChoicePicks from './choicePicks';
import Recommendations from './recommendations';

function Content() {
    return (
        <div>
            <div id = "home" style = "display: none">
                <Home />
            </div>
            <ChoicePicks />
            <Recommendations />
        </div>
    );
}

export default Content;
